pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Address.sol";

contract Escrow is Ownable {

    // Deposit function

    using Address for address payable;

    event Deposited(address indexed payee, uint256 weiAmount);


    address public contractor;
    address public client;
    address public admin;

    mapping(address => uint256) private _deposits;

    function deposit(address payee, address broker) public payable virtual onlyOwner {
        contractor = payee;
        client=msg.sender;
        admin = broker;
        uint256 amount = msg.value;
        _deposits[payee] += amount;
        emit Deposited(payee, amount);
    }

    //validation function

    bool public taskCompleted;
    bool public taskValidated;
    bool public adminResolution;
    uint256 public adminDecision;


//  event Withdrawn(address indexed payee, uint256 weiAmount);

    //   function withdraw(address payable payee) public virtual onlyOwner {
    //     uint256 payment = _deposits[payee];

    //     _deposits[payee] = 0;

    //     payee.sendValue(payment);

    //     emit Withdrawn(payee, payment);
    // }

    function adminResolutionStatus(bool inputAdminResolution, uint256 inputAdminDecision) public virtual{
    adminResolution = inputAdminResolution;
    adminDecision = inputAdminDecision;
    }


    function withdrawalAllowed() public view virtual returns (bool){
        if(taskCompleted == true && taskValidated == true){
            return true;
        }
        else if(adminResolution){return true;}
        else {return false;}
    }

    // function withdraw(address payable payee) public virtual override {
    //     require(withdrawalAllowed(payee), "ConditionalEscrow: payee is not allowed to withdraw");
    //     super.withdraw(payee);
    // }

}

